\begin{align}
\dfrac{dx}{dt} &= a\cdot \cos t \\
\dfrac{dy}{dt} &= a\cdot\left[ -\sin t + 
\underbrace{\dfrac{1}{\tan\frac{t}{2}}\cdot\sec^2\frac{t}{2}\cdot\frac{1}{2}}
_{\text{Chain Rule}} \right] \\
&= a\cdot\left[
-\sin t + \underbrace{\dfrac{1}{2\cdot\dfrac{\sin \frac{t}{2}}{\cos\frac{t}{2}}
\cdot \cos^2 \frac{t}{2}}}_{\sin 2\theta = 2\sin\theta\cdot\cos\theta} 
\right] \\
&= a\cdot\left[ \dfrac{\cos^2 t}{\sin t}\right]
\end{align}
